&gt; We’re excited to announce *SiteMinder’s 2020 Hackathon*, an opportunity to take some time out of your busy day-to-day and get creative! 
&gt; 
&gt; You can work on anything you like - there are no restrictions. The only catch is that you must demonstrate it. We also have some ideas if you’re struggling to agree on one as a team.
&gt; 
&gt; Teams are minimum of three, maximum of six with no restrictions to the skillset/makeup of the teams. 
&gt; 
&gt; <https://docs.google.com/spreadsheets/d/1SE9eXSO_r-zHlwfrwvPiqUtt3F7wWspy9chmikQGyfk/edit?usp=sharing|Here is the sheet to register your team>. If you want to participate but don’t have a team just pop your name on the second tab and we can help find you one. This is also a great opportunity to work with people you don’t always work with or know well. 
&gt; 
&gt; You can work remotely or you are welcome to come into the office and use the space on the ground floor. We will have snacks available and finish the hackathon with drinks and demos from 3pm on Friday. 
&gt; 
&gt; Team forming starts *now* so get recruiting! <https://siteminder.atlassian.net/wiki/spaces/HAC/overview|A confluence space> has also been set up with even more information.
